fetch('https://script.google.com/macros/s/AKfycbwQ5XGf8-vSQa4dwio4lDatODcjPqGQNsUYY04QSW4O5pMpGEwsOs1-sWDu3J7eY7Fzew/exec').then(a=>a.json()).then(A=>{let i=1;for(let _ of A.questions){let b=document.createElement('div');b.setAttribute('id',`question${i}`);let B=document.createElement('div');B.setAttribute('class','question');let c=document.createElement('div');c.setAttribute('class','solution');document.querySelector('#req_data').appendChild(b);b.appendChild(B);b.appendChild(c);B.innerHTML=`<h2>${i}) ${_.question}</h2>`;i!=1&&(c.innerHTML=`  
        <a class="btn btn-primary" data-bs-toggle="collapse" href="#multiCollapseExample${i}" role="button" aria-expanded="false" aria-controls="multiCollapseExample1">click here for answer</a>
        <div class="row">
      <div class="col">
        <div class="collapse multi-collapse" id="multiCollapseExample${i}">
          <div class="card card-body bg-danger-subtle">
           <p style="font-size: x-large;">${_.answer}</p>
          </div>
        </div>
      </div>
        </div><br />`);i++}});
